(184, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:43:\"Introducing Elementor AI for Image Creation\";s:7:\"excerpt\";s:234:\"Elementor 3.14 introduces the next phase of Elementor AI, which includes image generation. With Elementor AI you can describe the images you want to create, enhance existing images, customize and edit to adjust their size, and more.  \";s:7:\"created\";i:1687262804;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:131:\"https://elementor.com/blog/introducing-elementor-ai-images/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:70:\"Introducing Elementor AI  Revolutionize the Way You Create Websites\";s:7:\"excerpt\";s:232:\"Elementor includes a new natively integrated AI product, available as a free trial starting in Elementor 3.13. Benefit from a wide array of use cases available from directly within the Editor to transform the way you build websites.\";s:7:\"created\";i:1682945240;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:124:\"https://elementor.com/blog/introducing-elementor-ai/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:76:\"Introducing Elementor 3.12  Design Beautiful and Sophisticated Mega Menus\";s:7:\"excerpt\";s:245:\"Elementor 3.12 includes a number of eagerly awaited features that will take your websites design and navigation to the next level. This version also reveals the first phase of the Elementor interface revamp, and expands existing capabilities.\";s:7:\"created\";i:1680605140;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:146:\"https://elementor.com/blog/new-mega-menu-loop-alternate-template-and-more/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
