(20953, 2542, '_elementor_data', '[{\"id\":\"7c07034\",\"elType\":\"section\",\"settings\":{\"layout\":\"full_width\",\"background_background\":\"classic\",\"background_image\":{\"url\":\"https:\\/\\/bintybyte.com\\/wp-content\\/uploads\\/2023\\/04\\/163.jpg\",\"id\":305,\"size\":\"\",\"alt\":\"\",\"source\":\"library\"},\"_ha_condition_list\":[{\"_id\":\"84a2e24\"}],\"margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":0,\"bottom\":\"0\",\"left\":0,\"isLinked\":false},\"padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[{\"id\":\"d61b252\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"_ha_condition_list\":[{\"_id\":\"53de8ea\"}]},\"elements\":[{\"id\":\"df4fd2e\",\"elType\":\"widget\",\"settings\":{\"icon_list\":[{\"text\":\"\",\"selected_icon\":{\"value\":\"fas fa-home\",\"library\":\"fa-solid\"},\"_id\":\"468feac\",\"link\":{\"url\":\"http:\\/\\/ctslweb.co.in\\/Bintybyte\",\"is_external\":\"\",\"nofollow\":\"\",\"custom_attributes\":\"\"},\"__dynamic__\":[]},{\"_id\":\"55ec88d\",\"text\":\"List Item\",\"selected_icon\":{\"value\":\"fas fa-chevron-right\",\"library\":\"fa-solid\"},\"__dynamic__\":{\"text\":\"[elementor-tag id=\\\"f96eb5d\\\" name=\\\"page-title\\\" settings=\\\"%7B%7D\\\"]\"}}],\"icon_align\":\"center\",\"icon_color\":\"#FFFFFF\",\"icon_size\":{\"unit\":\"px\",\"size\":17,\"sizes\":[]},\"text_indent\":{\"unit\":\"px\",\"size\":2,\"sizes\":[]},\"text_color\":\"#FFFFFF\",\"_margin\":{\"unit\":\"px\",\"top\":\"140\",\"right\":\"0\",\"bottom\":\"100\",\"left\":\"0\",\"isLinked\":false},\"ha_advanced_tooltip_content\":\"I am a tooltip\",\"__globals__\":{\"icon_typography_typography\":\"\"},\"view\":\"inline\",\"space_between_mobile\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]},\"icon_typography_typography\":\"custom\",\"icon_typography_font_family\":\"Helvetica\",\"icon_typography_font_size_mobile\":{\"unit\":\"px\",\"size\":13,\"sizes\":[]},\"icon_typography_font_weight\":\"700\"},\"elements\":[],\"widgetType\":\"icon-list\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"982eeb9\",\"elType\":\"section\",\"settings\":{\"margin\":{\"unit\":\"px\",\"top\":\"50\",\"right\":0,\"bottom\":\"100\",\"left\":0,\"isLinked\":false},\"padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"20\",\"bottom\":\"0\",\"left\":\"20\",\"isLinked\":false}},\"elements\":[{\"id\":\"4cc4ac6\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"d7fd592\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Who we are<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>Our website address is: http:\\/\\/ctslweb.co.in\\/Bintybyte.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Comments<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor\\u2019s IP address and browser user agent string to help spam detection.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:paragraph --><\\/p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https:\\/\\/automattic.com\\/privacy\\/. After approval of your comment, your profile picture is visible to the public in the context of your comment.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Media<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Cookies<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:paragraph --><\\/p><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:paragraph --><\\/p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \\\"Remember Me\\\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:paragraph --><\\/p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Embedded content from other websites<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:paragraph --><\\/p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Who we share your data with<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>If you request a password reset, your IP address will be included in the reset email.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">How long we retain your data<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:paragraph --><\\/p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">What rights you have over your data<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.<\\/p><p><!-- \\/wp:paragraph --> <!-- wp:heading --><\\/p><h2 class=\\\"wp-block-heading\\\">Where your data is sent<\\/h2><p><!-- \\/wp:heading --> <!-- wp:paragraph --><\\/p><p><strong class=\\\"privacy-policy-tutorial\\\">Suggested text: <\\/strong>Visitor comments may be checked through an automated spam detection service.<\\/p><p><!-- \\/wp:paragraph --><\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Helvetica\",\"typography_font_size\":{\"unit\":\"px\",\"size\":13,\"sizes\":[]},\"typography_font_weight\":\"400\",\"typography_line_height\":{\"unit\":\"px\",\"size\":27,\"sizes\":[]},\"ha_advanced_tooltip_content\":\"I am a tooltip\",\"__globals__\":{\"text_color\":\"globals\\/colors?id=9f087c8\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
