(2542, 1, '2023-05-20 04:19:47', '2023-05-20 04:19:47', '<link rel=\"stylesheet\" href=\"http://ctslweb.co.in/Bintybyte/wp-content/uploads/elementor/css/custom-widget-icon-list.min.css?ver=1683011721\">		<ul>\n							<li>\n											<a href=\"http://ctslweb.co.in/Bintybyte\">\n											</a>\n									</li>\n								<li>\n									</li>\n						</ul>\n		<p><!-- wp:heading --></p><h2>Who we are</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>Our website address is: http://ctslweb.co.in/Bintybyte.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>Comments</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitors IP address and browser user agent string to help spam detection.</p><p><!-- /wp:paragraph --> <!-- wp:paragraph --></p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>Media</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>Cookies</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p><!-- /wp:paragraph --> <!-- wp:paragraph --></p><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p><!-- /wp:paragraph --> <!-- wp:paragraph --></p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p><!-- /wp:paragraph --> <!-- wp:paragraph --></p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>Embedded content from other websites</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p><!-- /wp:paragraph --> <!-- wp:paragraph --></p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>Who we share your data with</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>How long we retain your data</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p><!-- /wp:paragraph --> <!-- wp:paragraph --></p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>What rights you have over your data</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><p><!-- /wp:paragraph --> <!-- wp:heading --></p><h2>Where your data is sent</h2><p><!-- /wp:heading --> <!-- wp:paragraph --></p><p><strong>Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><p><!-- /wp:paragraph --></p>', 'Privacy Policy', '', 'publish', 'closed', 'closed', '', 'privacy-policy', '', '', '2023-05-20 04:59:58', '2023-05-20 04:59:58', '', 0, 'http://ctslweb.co.in/Bintybyte/?page_id=2542', 0, 'page', '', 0),
(2562, 1, '2023-05-20 04:46:06', '2023-05-20 04:46:06', '<link rel=\"stylesheet\" href=\"http://ctslweb.co.in/Bintybyte/wp-content/uploads/elementor/css/custom-widget-icon-list.min.css?ver=1683011721\">		<ul>\n							<li>\n											<a href=\"http://ctslweb.co.in/Bintybyte\">\n											</a>\n									</li>\n								<li>\n									</li>\n						</ul>\n		<p><!-- wp:heading --></p>\n<h3><strong>Terms &amp; Conditions</strong></h3>\n<hr />\n<h3></h3>\n<p><strong>www.bintybyte.com</strong>is a leading service provider in the IT industry, providing the best of facilities at competitive market rates. However, recent detection of misuse of our services have compelled us to take action against the violating clients and also lay down a few terms and conditions.</p>\n<p>We own the sole rights to discontinue the services or deny access to anyone who fails to comply with the rules implemented by us, without any warning or prior notice. The payments received from the violating parties in such cases are also non-refundable.</p>\n<p>Any inconvinience caused to the CUSTOMER SUPPORT in terms of threatening, abusing or annnoying will be considered very serious and results in suspension of account . <strong>www.bintybyte.com</strong>does not provide any support to sub clients.</p>\n<ul>\n<li>Misuse of the allotted server space, bandwidth etc. By the client will lead to reduction in the space and facility given.Effecting companies brand name or privacy in anyways (adding fake reviews on other sites,spamming) being an EXISTING CLIENT of <strong>www.bintybyte.com</strong>will be a serious issue and the account will be Suspended without any prior information and no refund will be done in such case.</li>\n<li>Distribution of free email IDs or Webspace to any person other than the ones related to the website owner or the company automatically gives <strong>www.bintybyte.com</strong>the rights to decrease the number of email IDs provided.</li>\n<li>Incase of misuse of allotted email ID space, we will have the rights to diminish the space provided for one email ID.</li>\n<li>All disputes are subject to Cuttack jurisdiction only.</li>\n<li>Misuse of bandwidth will lead a client to be entitled for lesser bandwidth in future or account would be suspended.</li>\n<li>Any illegal activity detected on a website will lead to sealing of the same by us with immediate effect, as per the IT rules laid out by the Indian and International IT Act.</li>\n<li>Intentionally tampering (Hacking or sending virus) of our server by a client will see the account suspended.</li>\n<li>Customers are advised to maintain data backups on their home computers or CDs to ensure that they have ready access to their data in case we have a hardware failure. However, such cases are rare in occurrence, but cannot be avoided sometimes. This is why we recommend all our clients to take regular backups for all their important e-mails and data by forwarding mails to other domain email IDs or by using Outlook.</li>\n<li>For safety reasons, we urge our customers not to divulge the password of their e-mail/hosting/ftp accounts to anyone. In cases where passwords and usernames are to be given to our employees, we suggest to change the password immediately. In every 15 days you have to change your all password for security reason.</li>\n<li>Customers should also maintain their payment confirmation details that have been paid to us for activation of the orders. It is also advisable to maintain the backup of our first mail which is sent to you after activation of your order and contains your User ID and password. By using the details provided, we will be able to provide you Technical/Billing support and activation/renew/control panel/reset password facility ect.</li>\n<li>Unfortunately if website/server etc will down then we are not responsible for any losses face by client.</li>\n<li>For plan details and services provided by <strong>www.bintybyte.com</strong>, please refer to the website as the most valid reference. Any commitment made by our employees over chat/phone/mail or by any other mode, which is not mentioned in our website, will not be abided.</li>\n</ul>\n<p><b>Abuse of SMTP Mail Server:</b></p>\n<p>If any of the email id will be misuse the mail server then we will suspended his hosting account.</p>\n<p><b>Network security:</b></p>\n<p>In case of any tampering done to our network security, we will take an immediate action against the respective hosting account.</p>\n<p><b>Spam:</b></p>\n<p>Unsolicited commercial advertisements (spam) are not allowed in e-mail IDs and may result in cancellation of the account.</p>\n<p><b>Abuse of Traffic:</b></p>\n<p>If any customer violates the companys policies in site transfer or misuse of bandwidth, <strong>www.bintybyte.com</strong>can decrease its allotted Traffic quota or suspended his account without any prior notice.</p>\n<p><b>Late/Non-Payment:</b></p>\n<p>48 hours past your due date, your account will be suspended (Extra Rs. 500 for Hosting Packages &amp; Rs. 1000 for Reseller Packages reactivation fee will apply).</p>\n<p><b>Abuse of Space:</b></p>\n<p>As per our policies, at least 90% of your web pages (HTML) must be Linked with files (.GIF, .JPEG, etc.) which is stored in our server. Web space must not be used by your visitor for free upload, download heavy size file. Web sites containing a large number of unlinked files or using server space for data storing propose are subject to deletion of files otherwise we will cancellation the account without prior notice.</p>\n<p>Customers can not run IRC, bots or clients on servers.</p>\n<p>Customers are also prohibited from running Bulk E-mailing, Unsolicited E-mailing, Newsgroup Spamming, Pornographic Content, Illegal Content, Copyright Infringement, Trademark Infringement, Warez, Cracks, and Software Serial Numbers, Audio or video streaming, Phishing,Fraud, Spam, Gambling, Arcade Gaming, Nulled Scripts, File Hosting, Proxy, Torrentflux or similar, Rapidleech or similar websites</p>\n<p><b>Large File Policy:</b></p>\n<p><strong>www.bintybyte.com</strong> is not for file hosting and distribution  as such, customers may not host any files larger than 150MB in size that are observed to be available for the sole purpose of download. Such files include but are not limited to .ISO, audio/video files, .EXE files. If you are unsure whether your file is against this policy, please e-mail admin@bintybyte.com.</p>\n<p><b>Guarantees Policy:</b></p>\n<p>To prove to you how confident we are in our services, we will offer you a 30 day money back guarantee on web hosting plans and packages. Domain name registration, promotional offers and transfers are non-refundable. If for any reason you are not completely satisfied with our services and cancel your account within the initial 30 days from the initial order date of your account we will refund you all your money (excluding any setup fees). Refunds may take up to two weeks to process.</p>\n<p><strong>www.bintybyte.com</strong> will not issue refunds to users who have their account terminated/suspended by <strong>www.bintybyte.com</strong>, for breach of our terms of service. refunds will not be made to users who exceed their allocated bandwidth limit. accounts that are renewed for additional terms are also not subject to our money back guarantees.</p>\n<p><!-- /wp:paragraph --></p>', 'Term & Condition', '', 'publish', 'closed', 'closed', '', 'term-condition', '', '', '2023-05-22 05:13:29', '2023-05-22 05:13:29', '', 0, 'http://ctslweb.co.in/Bintybyte/?page_id=2562', 0, 'page', '', 0),
