(2658, 1, '2023-05-22 10:53:18', '2023-05-22 10:53:18', 'Were seeking an experienced IT support person to join us on this journey, using their technology skills to make us even more efficient. In this role, the support person will oversee IT systems and assets, assist with upgrades and fixes, and provide training and support as needed. The ideal candidate will have extensive knowledge of computer hardware and software, network maintenance, and industry trends to keep us on the cutting edge. Engaging with employees throughout the company, the IT support person will have an immediate impact on the efficiency of our operations and overall growth.', 'Sample Job', '', 'publish', 'closed', 'closed', '', 'thjm-sample-job', '', '', '2023-05-22 10:53:18', '2023-05-22 10:53:18', '', 0, 'http://ctslweb.co.in/Bintybyte/jobs/thjm-sample-job/', 0, 'thjm_jobs', '', 0),
